import React, {Component} from 'react';
import Feira from '../../components/Feira/Feira';

class Feiras extends Component {
    state = {
        feira: []
    }

    
    componentDidMount() {
        console.log(this.state);
        let feiras = [];
        feiras.push({nome: "nome 1"});
        feiras.push({nome: "nome 2"});
        console.log(feiras);

    }

    render(){

        return(
            <div>
                <Feira local={this.state.feira.local} nome={this.state.feira.nome} feira={this.state.feira}></Feira>
                <Feira></Feira>
            </div>
        );
    };
}

export default Feiras;
